import './App.css';

function App() {
  const list = [{
    title: "Halloween 2",
    director: "John Carpenter",
    releaseYear: 1981
  },
  {
    title: "It",
    director: "Stephen King",
    releaseYear: 1990
  }
  ]

  return (
    <div className="App">

      <label htmlFor="search">search</label>
      <input id="search" type="text"/>

      <hr/>

      <h1>
        Horror Classics:
      </h1>

      <p>
        { list.map(function(movie) {
            <p>movie.title</p>
          })
        }
      </p>
    </div>
  );
}

export default App;
